window.bookSummaryJSON = "<p>Lowell Hemming is stuck.</p> <p>Grounded from his job, this werewolf is pulling his hair out being back in his small hometown. The first Hemming to leave Cambric Creek, he's feeling the pressure from his mother to move back home, is chafed by his family name, and hasn't gotten laid in months. When he picks up an intriguingly worded flyer, he hopes that his boredom is about to come to an end.</p> <p>For the first time in her life, Moriah has an open door of possibility before her. Recently divorced, she's free to do what she's always wanted. There's only one thing holding her back—the desire to have a child.</p> <p>Moon Blooded Breeding Clinic offers a unique service—trigger a heat and breed with a werewolf.</p> <p>When Moriah picks a handsome werewolf out of a catalog, it seems as easy as buying a pair of shoes. She doesn't count on liking him.</p> <p>When Lowell gets the call that he's been chosen, all he's looking forward to is scratching a physical itch. Catching feelings is not part of the contract. But when he meets the gorgeous redhead who's picked him, walking away from her after he's fulfilled his end of the contract is harder than he thought.</p> <p>Contains mature themes.</p>"; 
